import "../css/challenges.css";
export default function Challenges() {
  return (
    <>
        <div className="challenges-main-container">
            <div className="challenges-xp-progress">
                <div className="curr-xp-progress">560<span>xp</span></div>
                <div className="goal-xp-progress">2,000<span>xp</span></div>
            </div>
            <div className="xp-progress-bar">
                <div className="xp-inner-progress-bar"></div>
            </div>
        </div>
    </>
  );
}
